"use strict";(self.webpackChunksoulmatters_ro=self.webpackChunksoulmatters_ro||[]).push([[5695],{5695:e=>{e.exports=JSON.parse('{"author":"Andra Cozma","date":"2017-11-28T18:12:50.000Z","slug":"solutii","status":"publish","title":"Solu\u021bii","excerpt":"Doar s\u0103 vrei \u0219i s\u0103 ceri! Numai atunci vei primi solu\u021bii bune pentru tine. Mai cu seam\u0103, ceva De Te  ","article":"Doar s\u0103 vrei \u0219i s\u0103 ceri! Numai atunci vei primi solu\u021bii bune pentru tine.\\n\\nMai cu seam\u0103, ceva **D**e **T**e **T**esteaz\u0103 la suflu. Dac\u0103 \xeel g\u0103sesc, \xeel scot repede, ca la carte. \xcel scot absolut din fiecare fir de p\u0103r pierdut sau unghier \xeentunecat descoperit. Este un lucru m\u0103re\u021b, cercetat \u0219i avizat. E\u0219ti pe m\xe2ini sigure, ai \xeencredere!\\n\\nDup\u0103 prima etap\u0103, urmeaz\u0103 Crema. Crema de netezire cu thoriu. Ulterior, e\u0219ti pudrat atent cu pulbere tot din acela\u0219i con\u021binut. Numai a\u0219a vei putea str\u0103luci \u0219i \xeei vei putea lumina \u0219i pe ceilal\u021bi, chiar de la distan\u021b\u0103. Doar astfel vei triumfa victorios, deasupra tuturor.\\n\\nCa s\u0103 ai parte de aceste beneficii, urm\u0103toarul pas este s\u0103 strigi din tot suflul c\u0103 vrei, apoi s\u0103 \xeei aduni \u0219i pe ceilal\u021bi. Lu\xe2ndu-i pe al\u021bii cu tine, ve\u021bi deveni mai mari \u0219i mai puternici. Ve\u021bi avea ce s\u0103 l\u0103sa\u021bi \xeen urma voastr\u0103 \xeen anii vo\u0219tri de \u201em\u0103turitate\u201d fie ea electric\u0103 sau clasic\u0103.\\n\\nBeneficiezi de tot ce-i mai bun. Sunt solu\u021bii pentru to\u021bi, oferind multe drepturi altora. Astfel, str\u0103lucirea victoriei se va observa de oriunde.\\n    ","previous":{"slug":"obiecte","title":"Obiecte"},"next":{"slug":"albinuta-si-gandacelul-de-balegar","title":"Albinu\u021ba \u0219i g\xe2nd\u0103celul de b\u0103legar"}}')}}]);